import React from 'react';
import FormList from './components/FormList/FormList';

function App() {
  return (
    <div className="App">
      <div className="container">
          <nav class="navbar navbar-light bg-light">
            <a class="navbar-brand" href="#">
                Bootstrap
              </a>
            </nav>
        <h1>Hello React</h1>
        <FormList></FormList>
      </div>
    </div>
  );
}

export default App;
